<?php $__env->startSection('content'); ?><p>The Bachelor #24 alum Victoria Fuller announced Wednesday that she ended her five-month romance with The Bachelor #19 Chris Soules, who apparently wanted her to move to his native Iowa.</p>

<p>'I'm not moving to Iowa anytime soon,' the Virginia-born 26-year-old told The Viall Files.</p>

<p>'He is an amazing man and he deserves somebody super awesome who's willing to go to Iowa and live in Iowa and right now, I'm not there yet. Maybe I will be in a couple [of] years.'  </p>

