<p>Victoria said she still talks to the 38-year-old fourth-generation farmer 'all the time' but she's 'in a different place than he is' at the moment.</p>

<p>'I just want to focus on myself right now,' Fuller explained. 'I'm not a farmer, but I know a lot about f***ing corn now.'</p>

<p>The medical sales rep began quarantining with Chris in April three weeks after being connected by his former prospective bride, Kelsey Weier.</p>

<p>'[Kelsey] basically just, like, set it up and he ended up texting me within like five minutes of her giving him my number,' Victoria recalled.     </p>

